import React, {useState} from 'react'
import { Container, Row, Col, Text, Form, FormGroup, Label} from 'reactstrap'
import { Icon, Input } from 'semantic-ui-react'
import {Link, NavLink} from 'react-router-dom'
import { Column } from 'ag-grid-community'
import Home from './Home'
import {localeProvider, LOCALES} from '../locale/locales';
import { FormattedMessage} from 'react-intl';
import implementation from '../locale/implementation';


const Step4 = () =>{
    const[locale, setlocale] = useState([LOCALES.ENGLISH]);
    return (
        < localeProvider locale={locale} >
        <Container>
            <br/>
            <br/>
            <br/>
            <br/>
       <h3> {implementation('finished')} <br/>
            {implementation('contact')}</h3> 
        <Row>
        <Col>
            <div><li><Link to="/Home">Back To Main Page</Link></li></div>
            </Col>
        </Row>
        </Container>
        </localeProvider>
    )
}
export default Step4;
